import React from 'react';
import Header from './components/Layout/Header';
import Summary from './components/Layout/Summary';
import Meals from './components/Meals/Meals';
function App() {

  const meals = [
    { name: 'Spaghetti Carbonara', description: 'Delicious pasta with bacon and eggs', price: 12.99 },
    { name: 'Margherita Pizza', description: 'Classic tomato and mozzarella pizza', price: 10.99 },
    { name: 'Chicken Alfredo', description: 'Creamy pasta with chicken and parmesan', price: 14.99 },
    { name: 'Caesar Salad', description: 'Fresh salad with Caesar dressing', price: 8.99 },
    { name: 'Sushi Platter', description: 'Assorted sushi rolls and sashimi', price: 18.99 },
  ];


  return (
    <div>
      <Header />
      <Summary />

      <div className="meals">
        {meals.map((meal, index) => (
          <Meal
            key={index}
            name={meal.name}
            description={meal.description}
            price={meal.price}
          />
        ))}
      </div>

    </div>
  );
}

export default App;
